import React from "react";
import "./signup.css";
import "../theme.css";
import { Input } from "../../components/SignupComponents/Input";

export const SignUpPage = () => {
  const handleNextClick = () => {
    console.log("Next button clicked!");
  };

  const logoOne = require("./wallet.png");

  return (
    <div className="screen">
      <div className="page">
        <div className="center">
          <div className="flex-col flex justify-center items-center mb-4 relative">
            <img src={logoOne} alt="alt" className="h-16 " />
            <h1 className="font-bold text-xl logo absolute top-10">
              WalletWise
            </h1>
          </div>

          <div className="w-1/4 p-10 flex flex-col justify-between rounded-xl login">
            <div className="pic">
              <div className="uploadpic"></div>
              <h1 className="addpic  font-semibold mt-2 mb-5">
                Add a profile picture!
              </h1>
            </div>
            <Input />
            <div className="click">
              <button type="button" className="next" onClick={handleNextClick}>
                NEXT
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
